import React from 'react';

function Hello(props) {
    return(
        <>
            <div>
                {props.hello}
            </div>
            <button onClick={props.doIt}>Change</button>
            <button onClick={props.dothis}>Revert</button>
        </>
    );
};

export default Hello;
